import React, { useEffect } from 'react';
// import axios from 'axios';

export default function OpenWeatherScraper() {
    const [weather, setWeather] = React.useState([]);

    useEffect(() => {
        setWeather(1)
        console.log(weather)
        // Inside this callback function we perform our side effects.
    }, []);

    return (
        <h1>{weather}</h1>
    )
}
